                                                                                                      "            if (mode == \"i\") then {",
                                                                                                      "                tok := if (keywords.contains(accum)) then {",
                                                                                                      "                    keywordToken(accum)",
                                                                                                      "                } else {",
                                                                                                      "                    identifierToken(accum)",
                                                                                                      "                }",
                                                                                                      "                tokens.push(tok)",
                                                                                                      "            } elseif { mode == \"\\\"\" } then {",
                                                                                                      "                tok := stringToken(accum)",
                                                                                                      "                tokens.push(tok)",
                                                                                                      "            } elseif { mode == \"q\" } then {",
                                                                                                      "                tok := multiLineStringToken(accum)",
                                                                                                      "                tokens.push(tok)",
                                                                                                      "            } elseif { mode == \",\" } then {",
                                                                                                      "                tok := commaToken",
                                                                                                      "                tokens.push(tok)",
                                                                                                      "            } elseif { mode == \".\" } then {",
                                                                                                      "                tok := dotToken",
                                                                                                      "                tokens.push(tok)",
                                                                                                      "            } elseif { mode == \"\\{\" } then {",
                                                                                                      "                tok := lBraceToken",
                                                                                                      "                tokens.push(tok)",
                                                                                                      "            } elseif { mode == \"}\" } then {",
                                                                                                      "                tok := rBraceToken",
                                                                                                      "                tokens.push(tok)",
                                                                                                      "            } elseif { mode == \"(\" } then {",
                                                                                                      "                tok := lParenToken",
                                                                                                      "                tokens.push(tok)",
                                                                                                      "            } elseif { mode == \")\" } then {",
                                                                                                      "                tok := rParenToken",
