                                                                                                      "                    errormessages.syntaxError(\"empty parenthesis are not allowed. \" ++",
                                                                                                      "                        \"Remove them, or put something between them.\")",
                                                                                                      "                        atRange(tok.line, tokens.last.linePos, tok.linePos)",
