                                                                                                      "                tok := rSquareToken",
                                                                                                      "                tokens.push(tok)",
                                                                                                      "            } elseif { mode == \"\" } then {",
                                                                                                      "                tok := lGenericToken",
                                                                                                      "                tokens.push(tok)",
                                                                                                      "            } elseif { mode == \"\" } then {",
                                                                                                      "                tok := rGenericToken",
