                                                                                                      "            cOrd - AOrd + 10",
                                                                                                      "        } elseif { (cOrd >= aOrd) && (cOrd <= \"f\".ord) } then {",
                                                                                                      "            cOrd - aOrd + 10",
                                                                                                      "        } elseif { (cOrd >= zeroOrd) && (cOrd <= \"9\".ord) } then {",
                                                                                                      "            cOrd - zeroOrd",
                                                                                                      "        } else {",
