                                                                                                      "                    cLines.push(cLine)",
                                                                                                      "                    line := \"\"",
                                                                                                      "                    cLine := \"\"",
                                                                                                      "                }",
                                                                                                      "                wasCR := false",
                                                                                                      "            } elseif {c == \"\\l\"} then {",
