                                                                                                      "                cLines.push(cLine)",
                                                                                                      "                line := \"\"",
                                                                                                      "                cLine := \"\"",
                                                                                                      "                wasCR := false",
                                                                                                      "            } elseif {c == \"\\\\\"} then {",
                                                                                                      "                line := line ++ c",
                                                                                                      "                cLine := cLine ++ \"\\\\\\\\\"",
                                                                                                      "                wasCR := false",
                                                                                                      "            } elseif {c == \"\\\"\"} then {",
                                                                                                      "                line := line ++ c",
                                                                                                      "                cLine := cLine ++ \"\\\\\\\"\"",
                                                                                                      "                wasCR := false",
                                                                                                      "            } else {",
                                                                                                      "                line := line ++ c",
                                                                                                      "                cLine := cLine ++ c",
                                                                                                      "                wasCR := false",
                                                                                                      "            }",
                                                                                                      "        }",
