                                                                                                      "        }",
                                                                                                      "        lexinput(lines)",
                                                                                                      "    }",
                                                                                                      "",
                                                                                                      "    method lexinput(inputLines) {",
                                                                                                      "        // tokens is a doubly-linked list of tokens.",
                                                                                                      "        var tokens := object {",
                                                                                                      "            var first is readable := false",
