                                                                                                      "                    polled",
                                                                                                      "                }",
                                                                                                      "            }",
                                                                                                      "",
                                                                                                      "            method size {",
                                                                                                      "                size' + 0",
                                                                                                      "            }",
                                                                                                      "",
                                                                                                      "            method iter {",
                                                                                                      "                object {",
                                                                                                      "                    var n := first",
                                                                                                      "                    method havemore {",
                                                                                                      "                        n != false",
                                                                                                      "                    }",
