                                                                                                      "                        n != false",
                                                                                                      "                    }",
                                                                                                      "                    method next {",
                                                                                                      "                        def ret = n",
                                                                                                      "                        n := n.next",
                                                                                                      "                        ret",
                                                                                                      "                    }",
                                                                                                      "                }",
