                                                                                                      "                iter",
                                                                                                      "            }",
                                                                                                      "            ",
                                                                                                      "            method do(action) {",
                                                                                                      "                var n := first",
                                                                                                      "                while { n != false } do {",
                                                                                                      "                    action.apply(n)",
                                                                                                      "                    n := n.next",
                                                                                                      "                }",
                                                                                                      "            }",
                                                                                                      "        }",
                                                                                                      "",
                                                                                                      "        var mode := \"d\"",
                                                                                                      "        var newmode := mode",
